import React from "react";
import { GoogleMap, Marker, MarkerClusterer } from "@react-google-maps/api";
import "./Map.css";

function Map() {
  return (
    <div className="container">
      <div className="controls">
        <h1>Commute?   </h1>
      </div>

      <div className="map">
        <GoogleMap zoom={10} center={{ lat: 43, lng: -80 }}></GoogleMap>
      </div>
    </div>
  );
}

export default Map;
